import React from 'react'

import './map.scss'

interface MapProps {
    className?: string;
    style?: object;
    coordinates:{
        lat:number;
        lng:number;
    }
}

export const Map:React.FC<MapProps>   = (
    {
        className,
        style,
        coordinates
    }
) => {
  return (
    <div className={`map ${className}`} style={style}>
    </div>
  )
}
